import React from "react";

import "./App.css";

import Menubar from "./component/menubar";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div>
      <Menubar />
      <Switch>
        <Route path="/about">
          <div>I am about</div>
        </Route>
        <Route path="/users">
          <div>I am users</div>
        </Route>
        <Route path="/">
          <div>I am home</div>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
